- input: "TEXT\x1CC00010033\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    the Commission's letter dated February 18, 2009. The remainder of the misdeposited
    contribution from Pacific NWRC Carpenters PAC was transferred in March 2009 and
    will appear on the Committee's April Monthly report. Payments for 'Printing &
    Postage/Absentee Mail' were generic pieces and not for the benefit of any candidate
    for federal office. The payee for the Levin Allocation transfer has been corrected
    to reflect that the money did actually go into the Committee's Federal Account.
    The name 'MTDP Non-Federal Account' was a clerical error and has been corrected.
    \ The money was actually transferred to the Committee's Federal Account. The payments
    classified as 'Exempt' on Schedule B for Line 30(b) do meet the definition of
    exempt activity as detailed in the Campaign Guide. No transfers-in from National
    Party Committees, including the Demoratic National Committee were used in paying
    for these exempt activities. The MEMO item on Schedule B for Line 21(b) has been
    corrected to correspond to a payment to American Express for $13578.14. Payments
    for 'Food and Beverage' were for the ongoing travel expenses of the Committee's
    Chairman and staff. Specific payments to Blackfoot River Brewing and Golden Corral
    were for combined staff meals. \n"
  record: fec.version.v6_3.TEXT
  result:
  - name: REC TYPE
    number: '1'
    value: TEXT
  - name: FILER COMMITTEE ID NUMBER
    number: '2'
    value: C00010033
  - name: TRANSACTION ID NUMBER
    number: '3'
    value: X0
  - name: BACK REFERENCE TRAN ID NUMBER
    number: '4'
    value: ''
  - name: BACK REFERENCE SCHED / FORM NAME
    number: '5'
    value: F3XA
  - name: TEXT4000
    number: '6'
    value: "This amendment is in response to the Commission's letter dated February
      18, 2009. The remainder of the misdeposited contribution from Pacific NWRC Carpenters
      PAC was transferred in March 2009 and will appear on the Committee's April Monthly
      report. Payments for 'Printing & Postage/Absentee Mail' were generic pieces
      and not for the benefit of any candidate for federal office. The payee for the
      Levin Allocation transfer has been corrected to reflect that the money did actually
      go into the Committee's Federal Account. The name 'MTDP Non-Federal Account'
      was a clerical error and has been corrected.  The money was actually transferred
      to the Committee's Federal Account. The payments classified as 'Exempt' on Schedule
      B for Line 30(b) do meet the definition of exempt activity as detailed in the
      Campaign Guide. No transfers-in from National Party Committees, including the
      Demoratic National Committee were used in paying for these exempt activities.
      The MEMO item on Schedule B for Line 21(b) has been corrected to correspond
